import React, { useState, useEffect } from 'react';

function BusinessInsights() {
  const [restaurantData, setRestaurantData] = useState([]);

  useEffect(() => {
    // Appel à une API pour récupérer les données des restaurants
    fetch('/api/restaurantData')
      .then(response => response.json())
      .then(data => setRestaurantData(data))
      .catch(error => console.error('Erreur lors de la récupération des données des restaurants', error));
  }, []);

  return (
    <div>
      <h2>Tableau de bord des informations commerciales</h2>
      <table>
        <thead>
          <tr>
            <th>Nom du restaurant</th>
            <th>Type de cuisine</th>
            <th>Address</th>
            <th>Phone Number</th>
            <th>Email</th>
            <th>Opening Hours</th>
            <th>Delivery Areas</th>
          </tr>
        </thead>
        <tbody>
          {restaurantData.map(restaurant => (
            <tr key={restaurant.id}>
              <td>{restaurant.restaurantName}</td>
              <td>{restaurant.cuisineType}</td>
              <td>{restaurant.address}</td>
              <td>{restaurant.address}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default BusinessInsights;
